## Reproduction
```rust
use macroquad::prelude::*;

#[macroquad::main("MyGame")]
async fn main() {
    loop {
        if is_key_down(KeyCode::D) {
            println!("D is down");
        }

        next_frame().await
    }
}
```

When the program is running, press `CMD+d` as a chord. Until D is pressed again, the print will repeatedly fire. (There is nothing special about "D", it's just the arbitrary key I chose in my reproduction. Other modifier keys work fine).


## Versions

```toml
[dependencies]
macroquad = "0.4.14"
```

